INSERT INTO `block_content_revision__body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `langcode`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('basic', 0, 1, 1, 'en', 0, '<div class=\"row\">\r\n<div class=\"col-md-9 col-md-push-3\">&nbsp;\r\n<h2 class=\"block-title\">Learn About Magazine</h2>\r\n\r\n<p>A true online magazine that talks about fashion, beauty and things related to a word beautiful. We love everything but are focused on fashion brands, fashion designers, beauty marks and home accessories.</p>\r\n\r\n<p>What we write about? We follow all the things beautiful, trendy and pretty.​​</p>\r\n\r\n<p>Why Magazine? Because you adore being sexy and fashionable. And because you like to define your style and be unique. As are we.​ Come around every day and find something new. Click on the front cover to get into the magazine and then use a cursor or mouse to go forward or backward. Enjoy. :)​</p>\r\n\r\n<p><strong>​​E-mail us on</strong> <a class=\"link--bordered\" href=\"mailto:info@magazine.com\">info@magazine.com</a>. <strong>We accept all critics – good and bad ones.​</strong></p>\r\n</div>\r\n\r\n<div class=\"col-md-3 col-md-pull-9\"><img alt=\"about us\" src=\"//mttprojects.s3.amazonaws.com/demo.drupalizing.com/magazine-lite/demo-images/static-about-us-1.jpg\" /></div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 2, 2, 'en', 0, '<div class=\"row\">\r\n<div class=\"col-md-7\">\r\n<h2 class=\"block-title\">Our Team</h2>\r\n\r\n<p class=\"bottom-spacing-small\">With over 25 years of experience at the heart of the industry, the world’s most successful fashion and beauty professionals turn to our passionate team of experts and insiders to plan.</p>\r\n\r\n<p class=\"bottom-spacing-small\">Connect and engage in a competitive, evolving market for everyone interested:</p>\r\n\r\n<ul class=\"list--fa-check\">\r\n	<li>fully furnished shared accommodation/live out allowance</li>\r\n	<li>free transport to and from your place of work</li>\r\n	<li>biennial flight ticket, medical , life and accident insurance with retail and leisure discounts</li>\r\n</ul>\r\n\r\n<p><a class=\"link--bordered small\" href=\"#\">SEE FULL TEAM</a></p>\r\n</div>\r\n\r\n<div class=\"col-md-5\"><img alt=\"about us\" src=\"//mttprojects.s3.amazonaws.com/demo.drupalizing.com/magazine-lite/demo-images/static-about-us-2.jpg\" /></div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 3, 3, 'en', 0, '<div class=\"subscribe text-center\">\r\n  <div class=\"row\">\r\n    <div class=\"col-md-8 col-md-offset-2\">\r\n      <h4>Stay in the loop <br> and sign up for emails from us!</h4>\r\n      <form action=\"#\">\r\n        <div class=\"form-group\">\r\n          <div class=\"form-item form-item--style-2 form-type-textfield\">\r\n            <input class=\"form-text\" name=\"subscribe\" onblur=\"if (this.value == \'\') {this.value = \'Email Address\';}\" onfocus=\"if (this.value == \'Email Address\') {this.value = \'\';}\" type=\"text\" value=\"Email Address\" />\r\n          </div>\r\n          <div class=\"form-actions form-actions--style-2\">\r\n            <i class=\"fa fa-envelope\"></i>\r\n            <input class=\"form-submit\" type=\"submit\" value=\"Subscribe\"/>\r\n          </div>\r\n        </div>\r\n        <div class=\"form-item form-type-checkbox\">\r\n          <input type=\"checkbox\" name=\"checkbox\" value=\"1\" class=\"form-checkbox\">\r\n          <label class=\"option\">By subscribing, you accept our <a href=\"#\" class=\"link--bordered\">Terms and Conditions</a></label>\r\n        </div>\r\n      </form>    \r\n    </div>\r\n  </div>\r\n</div>', '', 'full_html'),
('basic', 0, 4, 4, 'en', 0, '<div class=\"row\">\r\n<div class=\"col-md-9 col-md-push-3\">\r\n<h2 class=\"block-title\">Contact Magazine</h2>\r\n\r\n<p>Want to join our team of writers and contribute to magazine.com? Send us your pitches on fashion, beauty, celebrity news, culture, op-eds and health with a summarizing paragraph of your story, as well as a hed and dek.</p>\r\n\r\n<p>Forward all freelance inquires and pitches to submissions@magazine.com.</p>\r\n</div>\r\n\r\n<div class=\"col-md-3 col-md-pull-9\"><img alt=\"contact us\" src=\"http://mttprojects.s3.amazonaws.com/demo.morethanthemes.com/magazineplus/placeholders/static-contact-us-1.jpg\" /></div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 5, 5, 'en', 0, '<p><strong>New York</strong><br />\r\n860 Forest Drive Arlington,VA 22206<br />\r\nPh: (012) 345 - 6789<br />\r\nFax: 555-323 4567</p>\r\n\r\n<p><strong>Texas</strong><br />\r\n488 Waldeck Street Grapevine, TX 76051<br />\r\nPh: (012) 345 - 0097<br />\r\nFax: 555-323 0034</p>\r\n', '', 'full_html'),
('basic', 0, 6, 6, 'en', 0, '<div class=\"visible-md visible-lg\">COPYRIGHT © 2017 MAGAZINE LITE. ALL RIGHTS RESERVED.</div>\r\n<div class=\"text-center visible-xs visible-sm\">COPYRIGHT © 2017 MAGAZINE LITE. ALL RIGHTS RESERVED.</div>', '', 'full_html'),
('basic', 0, 7, 7, 'en', 0, '<ul class=\"icons-list icons-list--small text-right xs-text-center\">\r\n	<li><a class=\"tooltip--white hover-color-facebook\" data-original-title=\"FACEBOOK\" data-placement=\"bottom\" data-toggle=\"tooltip\" href=\"http://www.facebook.com/morethan.just.themes/\" title=\"\"><i class=\"fa fa-facebook\"><span class=\"sr-only\">facebook</span></i></a></li>\r\n	<li><a class=\"tooltip--white hover-color-twitter\" data-original-title=\"TWITTER\" data-placement=\"bottom\" data-toggle=\"tooltip\" href=\"http://twitter.com/morethanthemes/\"><i class=\"fa fa-twitter\"><span class=\"sr-only\">twitter</span></i></a></li>\r\n	<li><a class=\"tooltip--white hover-color-googleplus\" data-original-title=\"GOOGLE+\" data-placement=\"bottom\" data-toggle=\"tooltip\" href=\"https://plus.google.com/118354321025436191714/posts\" title=\"\"><i class=\"fa fa-google-plus\"><span class=\"sr-only\">google plus</span></i></a></li>\r\n	<li><a class=\"tooltip--white hover-color-linkedin\" data-original-title=\"LINKEDIN\" data-placement=\"bottom\" data-toggle=\"tooltip\" href=\"http://www.linkedin.com/company/more-than-themes/\" title=\"\"><i class=\"fa fa-linkedin\"><span class=\"sr-only\">linkedin</span></i></a></li>\r\n</ul>\r\n', '', 'full_html'),
('basic', 0, 8, 8, 'en', 0, '<div class=\"logo-and-site-name-wrapper\">\r\n  <div class=\"logo\">\r\n    <a href=\"#\" title=\"Home\" rel=\"home\" class=\"site-branding__logo\">\r\n      <img src=\"http://mttprojects.s3.amazonaws.com/demo.morethanthemes.com/showcaseplus/placeholders/logo-bright.svg\" alt=\"Home\">\r\n    </a>\r\n  </div>\r\n  <div class=\"site-name site-branding__name\">\r\n    <a href=\"#\" title=\"Home\" rel=\"home\">Magazine Lite</a>\r\n  </div>\r\n  <div class=\"site-slogan site-branding__slogan\">FREE DRUPAL 8 THEME</div>\r\n</div>', '', 'full_html'),
('basic', 0, 9, 9, 'en', 0, '<div class=\"row grid-gutter-0\">\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"views-field-field-image\">\r\n<div class=\"overlay-container\"><span class=\"overlay overlay--colored\"><span class=\"overlay-inner\"><a class=\"overlay-title overlay-animated overlay-fade-top\" href=\"#\">Five reasons to start exercising today</a> </span> </span> <img alt=\"image one\" src=\"//mttprojects.s3.amazonaws.com/demo.drupalizing.com/magazine-lite/demo-images/post-1.jpg\" title=\"image one\" typeof=\"Image\" /></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"views-field-field-image\">\r\n<div class=\"overlay-container\"><span class=\"overlay overlay--colored\"><span class=\"overlay-inner\"><a class=\"overlay-title overlay-animated overlay-fade-top\" href=\"#\">Night Creams Will Help Your Skin To Relax</a> </span> </span> <img alt=\"image one\" src=\"//mttprojects.s3.amazonaws.com/demo.drupalizing.com/magazine-lite/demo-images/post-2.jpg\" title=\"image one\" typeof=\"Image\" /></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"views-field-field-image\">\r\n<div class=\"overlay-container\"><span class=\"overlay overlay--colored\"><span class=\"overlay-inner\"><a class=\"overlay-title overlay-animated overlay-fade-top\" href=\"#\">Five reasons to start exercising today</a> </span> </span> <img alt=\"image one\" src=\"//mttprojects.s3.amazonaws.com/demo.drupalizing.com/magazine-lite/demo-images/post-3.jpg\" title=\"image one\" typeof=\"Image\" /></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"views-field-field-image\">\r\n<div class=\"overlay-container\"><span class=\"overlay overlay--colored\"><span class=\"overlay-inner\"><a class=\"overlay-title overlay-animated overlay-fade-top\" href=\"#\">To Keep Makeup Looking Fresh Take A Powder</a> </span> </span> <img alt=\"image one\" src=\"//mttprojects.s3.amazonaws.com/demo.drupalizing.com/magazin